import BarraTopoMobile from "./BarraTopoMobile";
import Main from "./Main";
import SidebarBox from "./SidebarBox";
import BarraInferiorMobile from "./BarraInferiorMobile";

export default function App() {
  return (
    <>
    <BarraTopo />
    <BarraTopoMobile />
    <Main />
    <SidebarBox />
    <BarraInferiorMobile />
    </>
  );
}
